import Button from '../UI/Button/Button';

import './Modal.css';

function Modal(props) {
    return <div
        className="Modal"
        onClick={props.closeModal}>
            <h2>{props.title}</h2>
            {props.message && <p>{props.message}</p>}
            <Button
                type="button"
                clickHandler={props.clickHandler}>
                Click to continue
            </Button>
        </div>;
}

export default Modal;
